import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import Employer from "./pages/Employer";

function App() {
  return (
    <BrowserRouter>
      <div>
        <Link to="/employer">Go to Employer Page</Link>
      </div>

      <Routes>
        <Route path="/employer" element={<Employer />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
